    false,nt"url": null,nt"notes": "This annual narrative report for Waubay
    National Wildlife Refuge outlines Refuge accomplishments during the 1982 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    The report includes a planning section which discusses the master plan, public participation,
    and research and investigations. Refuge administration is outlined; information
    about personnel, youth programs, funding, and safety is given. Habitat management
    is also covered; subjects include wetlands, croplands, grasslands, grazing, haying,
    and pest control. The wildlife section of the report discusses endangered and threatened
    species, waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals,
    and animal control. The public uses of the Refuge described in this report include
    interpretive programs, hunting, outdoor recreation, and law enforcement. The equipment
    and facilities section of the report provides information about new construction,
    rehabilitation, major maintenance, equipment replacement, and energy conservation.
    Cooperative programs and items of interest are provided at the end.",nt"license_title":
